import React, { useEffect, useState } from "react";
import Button from "react-bootstrap/Button";
import { NavLink } from "react-router-dom";
import axios from "axios";
import Table from 'react-bootstrap/Table';

export default function Home() {
  const [data, setData] = useState([]);

  const getUserData = async () => {
    try {
      const response = await axios.get(
        "http://localhost:3001/loan",
        {
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      //console.log(response);
      const data = response.data;
     // console.log({ data });
      setData(response.data);
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getUserData();
  }, []);
  const useCustomers = (page, rowsPerPage) => {
    return useMemo(
      () => {
        return applyPagination(data, page, rowsPerPage);
      },
      [page, rowsPerPage]
    );
  };
  
  const useCustomerIds = (customers) => {
    return useMemo(
      () => {
        return customers.map((customer) => customer.id);
      },
      [customers]
    );
  };
  
  const Page = () => {
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const customers = useCustomers(page, rowsPerPage);
    const customersIds = useCustomerIds(customers);
    const customersSelection = useSelection(customersIds);
  
    const handlePageChange = useCallback(
      (event, value) => {
        setPage(value);
      },
      []
    );
  
    const handleRowsPerPageChange = useCallback(
      (event) => {
        setRowsPerPage(event.target.value);
      },
      []
    );
  
  return (
    <div className="container mt-2">
      <h2 className="text-center mt-2">Loan Details</h2>
      <div className="text-end">
        <Button variant="dark">
          <NavLink to="/register" className="text-decoration-none text-light ">
            Add Loan
          </NavLink>
        </Button>
      </div>
      <div className="row d-flex  align-iteams-center mt-5">
      <Table striped="columns">
      <thead>
        <tr>
          <th>id</th>
          <th>Name </th>
          <th>Loan Amount</th>
          <th>Duration</th>
          <th>Start Day</th>
          <th>More ...</th>
        </tr>
      </thead>
        {data.length > 0
          ? data.map((el, i) => {
              console.log(el);
              return (
                <>
             
      <tbody>
        <tr>
          <td>{el.loanId}</td>
          <td>{el.customerId}</td>
          <td>$ {el.amount}</td>
          <td>{el.duration}</td>
          <td>{new Date(el.date).toLocaleDateString()}</td>
          <td><Button variant="dark">
                        <NavLink
                          to={`/details/${el._id}`}
                          className="text-decoration-none text-light "
                        >
                          Details
                        </NavLink>
                      </Button></td>
        </tr>
        
          </tbody>
          
                  
                </>
              );
              
            })
          : ""}
          </Table>
      </div>
      
    </div>
  );
}}
